function showMonthYearWisepaymentHistory($startDate, $endDate, $paymentHistory){

   $paymentHistory=  strrev($paymentHistory);
    $zeroSets = str_split($paymentHistory, 3);

    $paymentStartDate = DateTime::createFromFormat('dmY', $startDate);
    $paymentEndDate = DateTime::createFromFormat('dmY', $endDate);
    $interval = $paymentStartDate->diff($paymentEndDate);
    $totalMonths = $interval->y * 12 + $interval->m;

    // print_r($interval);
    // Set end date as 23 months before start (inclusive total = 24)
    $paymentEndDate = (clone $paymentStartDate)->modify("-$totalMonths months");

    $monthMap = [];
    $currentDate = clone $paymentEndDate;
    $index = 0;

    // Fill months from oldest to newest
    while ($paymentEndDate <= $paymentStartDate && $index < count($zeroSets)) {
        $key = $currentDate->format('M-Y');
        $monthMap[$key] = $zeroSets[$index];

        $currentDate->modify('+1 month');
        $index++;
    }

    // Reverse to show newest first
    $reversedMonthMap = array_reverse($monthMap, true);
    return $reversedMonthMap;
}

function formatIndianNumber($number) {
    $number = (string)$number;
    $decimal = '';

    // Handle decimal part
    if (strpos($number, '.') !== false) {
        list($number, $decimal) = explode('.', $number);
        $decimal = '.' . $decimal;
    }

    $length = strlen($number);

    if ($length <= 3) {
        return $number . $decimal;
    }

    $lastThree = substr($number, -3);
    $restUnits = substr($number, 0, $length - 3);
    $formatted = '';

    while (strlen($restUnits) > 2) {
        $formatted = ',' . substr($restUnits, -2) . $formatted;
        $restUnits = substr($restUnits, 0, -2);
    }

    $formatted = $restUnits . $formatted;

    return $formatted . ',' . $lastThree . $decimal;
}

